import React from "react";
import Slider from "react-slick";
import CardProductItem from "./CardProductItem";
import WelcomeListStyle from '../../styles/WelcomeList.module.scss'
const WelcomeProductList = () => {
  const settings = {
    dots: true,
    infinite: false,
    arrows: false,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 4,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };

  return (
    <div className={ WelcomeListStyle.welcome}>
      <h1 className='text-center'>Cá này đang bán chạy</h1>
      
    </div>
  );
};

export default WelcomeProductList;
